'use strict';

// Сложность этого решения - O(N)

/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
const findTheDifference = (s, t) => {
  if (!s.length) return t;

  const map = new Map();

  for (const char of s) {
    if (!map.has(char)) {
      map.set(char, 1);
    } else {
      map.set(char, map.get(char) + 1);
    }
  }

  for (const char of t) {
    if (!map.has(char)) return char;

    if (map.has(char) && map.get(char) > 0) {
      map.set(char, map.get(char) - 1);
    } else if (map.has(char) && map.get(char) < 1) { // ЗДЕСЬ ВАЖНО ИМЕННО else if, ПОТОМУ ЧТО ВЫШЕ МЕНЯЕТСЯ ЗНАЧЕНИЕ ПО ЭТОМУ КЛЮЧУ, А ЗДЕСЬ ОПЯТЬ ЗАПРАШИВАЕТСЯ ЭТО ЗНАЧЕНИЕ
      return char;
    }
  }
};

